import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to be visible
    await page.waitForSelector('.product-card', { timeout: 5000 });

    // Select all product price elements
    const priceElements = await page.locator('.product-price').all();

    const prices = [];
    for (const element of priceElements) {
      const textContent = await element.innerText();
      // The text might contain the original price, e.g., "$59.50\n$79.99"
      // We extract the first price, remove the '$', and convert to a number.
      const priceString = textContent.split('\n')[0].trim().replace('$', '');
      if (priceString) {
        prices.push(parseFloat(priceString));
      }
    }

    // Take a screenshot after extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_prices_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_prices_extracted.png'));

    return {
      success: true,
      action: "Extracted all product prices from the page.",
      extractedData: {
        productPrices: prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to extract product prices.",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
